import { useEffect, useState } from 'react';
import "./Dashboard.css";

import Table from 'react-bootstrap/Table';
import axios from 'axios';
import Button from 'react-bootstrap/Button';
// import Modal from 'react-bootstrap/Modal';
// import FloatingLabel from 'react-bootstrap/FloatingLabel';
// import Form from 'react-bootstrap/Form';

function Example() {
    const [show, setShow] = useState(false);
    const [count, setCount] = useState(0);





    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);

    const handleCustomer = (e) => {
        e.preventDefault();

        if (id) {
            axios.put("http://localhost:5002/notes", { id, title, description, variant, price })
                .then((response) => {
                    // getProduct("");
                    setId("");
                    setTitle("");
                    setVariant("")
                    setDescription("");
                    setPrice("")


                })


        } else {
            axios.post("http://localhost:5002/notes", { id, title, description, variant, price })
                .then((response) => {
                    getProduct("");
                    setId("");
                    setTitle("");
                    setVariant("");
                    setDescription("");
                    setPrice("")
                    clearForm("");

                })

        }
    }
    const clearForm = () => {
        setId("");
        setTitle("");
        setVariant("");
        setDescription("");
        setPrice("")
    }
    const handleDelete = async (noteId) => {
        try {
            const response = await axios.delete('http://localhost:5002/notes', { data: { id: noteId } })
            console.log(response.data.data);
            getProduct();
        } catch (error) {
            console.error("There was an error deleting the user!", error);
        }
    };
    const userform = (noteData) => {
        setId(noteData.id);
        setProduct(noteData.product);
        setDescription(noteData.description);
        setVariant(noteData.variant);
        setPrice(noteData.price);
    }

    return (
        <>
            <Button variant="primary" className='btn-1' onClick={handleShow}>
                <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" class="bi bi-search" viewBox="0 0 16 16">
                    <path d="M11.742 10.344a6.5 6.5 0 1 0-1.397 1.398h-.001q.044.06.098.115l3.85 3.85a1 1 0 0 0 1.415-1.414l-3.85-3.85a1 1 0 0 0-.115-.1zM12 6.5a5.5 5.5 0 1 1-11 0 5.5 5.5 0 0 1 11 0" />
                </svg>
            </Button>

            <Modal show={show} onHide={handleClose}>
                <Modal.Header closeButton>
                    <Modal.Title>Modal heading</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    <FloatingLabel
                        controlId="floatingInput"
                        label="Name"
                        className="mb-3"
                    >
                        <Form.Control type="text" placeholder="name@example.com" />
                    </FloatingLabel>
                    <FloatingLabel controlId="floatingPassword" label="Product Name">
                        <Form.Control type="text" placeholder="Password" />
                    </FloatingLabel>
                </Modal.Body>
                <div className='btn-o'>
                    <h4 className='me-3'>Item</h4>
                    <Button variant="primary" onClick={handleClickMinus}>-</Button>{' '}
                    <h3 className='btn-2'>
                        {count}
                    </h3>
                    <Button variant="primary" onClick={handleClickPlus}>+</Button>{' '}
                </div>
                <Modal.Footer>
                    <Button variant="secondary" onClick={handleClose}>
                        Close
                    </Button>
                    <Button variant="primary" type='submit' onClick={handleClose}>
                        Save
                    </Button>
                </Modal.Footer>
            </Modal>



            <Table striped bordered hover>
                <thead>
                    <tr>
                        <th>Id</th>
                        <th>Product Name</th>
                        <th>Discription</th>
                        <th>Variant</th>
                        <th>Price</th>
                    </tr>
                </thead>
                <tbody>
                    {product.map(data => (
                        <>
                            <tr key={data.id}>
                                <td>{data._id}</td>
                                <td>{data.title}</td>
                                <td>{data.description}</td>
                                <td>{data.variant}</td>
                                <td>{data.price}</td>
                                <Button variant="primary" onClick={() => userform(data)} >Edit</Button>
                                <Button variant="danger" onClick={() => handleDelete(data.id)} >Delete</Button>
                            </tr>
                        </>
                    ))}
                </tbody>
            </Table >
        </>
    );
}

export default Example;
